Creating a direct equivalent of this class in Swift for iOS would not be possible because the Android and iOS platforms have different UI frameworks and APIs. However, I can provide a Swift class that achieves a similar result by stacking UIImages and applying transformations to them.

Here's a Swift class that stacks UIImages and applies transformations to them:

```swift
import UIKit

class StackedImages: UIView {
    private var images: [UIImage]
    private var iconScale: CGFloat = 0.70

    init(images: [UIImage], iconScale: CGFloat = 0.70) {
        self.images = images
        self.iconScale = iconScale
        super.init(frame: .zero)
        setupImages()
    }

    required init?(coder: NSCoder) {
        fatalError("init(coder:) has not been implemented")
    }

    private func setupImages() {
        for (index, image) in images.enumerated() {
            let imageView = UIImageView(image: image)
            imageView.contentMode = .scaleAspectFit
            imageView.translatesAutoresizingMaskIntoConstraints = false
            addSubview(imageView)

            NSLayoutConstraint.activate([
                imageView.centerXAnchor.constraint(equalTo: centerXAnchor),
                imageView.centerYAnchor.constraint(equalTo: centerYAnchor),
                imageView.widthAnchor.constraint(equalTo: widthAnchor, multiplier: iconScale),
                imageView.heightAnchor.constraint(equalTo: heightAnchor, multiplier: iconScale)
            ])

            switch index {
            case 1:
                imageView.transform = CGAffineTransform(translationX: 0, y: -(1 - iconScale) * bounds.height / 2)
            case 0:
                imageView.transform = CGAffineTransform(translationX: -(1 - iconScale) * bounds.width / 2, y: 0)
            default:
                break
            }
        }
    }

    override func layoutSubviews() {
        super.layoutSubviews()
        setupImages()
    }
}
```

This Swift class, `StackedImages`, takes an array of UIImages and an optional icon scale as input. It creates a UIView with stacked UIImageViews

In TypeORM, you can use the `json` or `jsonb` data type to store JSON data in a PostgreSQL database. Here's how you can define it in your TypeORM entity:

```typescript
import { Entity, PrimaryGeneratedColumn, Column } from "typeorm";

@Entity()
export class MyEntity {

    @PrimaryGeneratedColumn()
    id: number;

    @Column({ type: "json" }) // or "jsonb"
    data: any;
}
```

The difference between `json` and `jsonb` is that `jsonb` supports indexing, which can lead to more efficient searches. However, it also takes up more storage space. If you don't need to index the JSON data, `json` is a good choice. If you do need to index the data, or if storage space is not a concern, `jsonb` is the better choice.

