Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable
import scala.collection.mutable.ListBuffer

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder()
      .appName("HitRateCalculator")
      .master("local[*]")
      .getOrCreate()

    val sc = spark.sparkContext

    // Load onsite attributed data
    val onsiteData: JavaRDD[String] = sc.textFile("onsite_data.txt")

    // Load top frequent queries
    val topQueries: JavaRDD[String] = sc.textFile("top_queries.txt")

    // Broadcast top queries to all nodes
    val broadcastTopQueries: Broadcast[Array[String]] = sc.broadcast(topQueries.collect())

    // Initialize cache
    val cache = mutable.Map[String, (Long, Long)]()

    // Process onsite data
    val hitRate = onsiteData.mapPartitions(iter => {
      val cachePart = mutable.Map[String, (Long, Long)]()
      val hitCount = new ListBuffer[Long]()
      val missCount = new ListBuffer[Long]()

      while (iter.hasNext) {
        val line = iter.next()
        val Array(query, timestamp) = line.split("\t")

        if (broadcastTopQueries.value.contains(query)) {
          if (cachePart.contains(query)) {
            val (lastAccessTime, expiryTime) = cachePart(query)
            if (timestamp.toLong < expiryTime) {
              // Cache hit
              hitCount += 1
            } else {
              // Cache miss
              missCount += 1
              cachePart(query) = (timestamp.toLong, timestamp.toLong + 12 * 60 * 60 * 1000)
            }
          } else {
            // Cache miss
            missCount += 1
            cachePart(query) = (timestamp.toLong, timestamp.toLong + 12 * 60 * 60 * 1000)
          }
        }
      }

      // Update global cache
      cache ++= cachePart

      Iterator(hitCount.sum, missCount.sum)
    }).reduce((a, b) => (a._1 + b._1, a._2 + b._2))

    // Calculate hit rate
    val hitRateValue = hitRate._1.toDouble / (hitRate._1 + hitRate._2)

    println(s"Hit rate: $hitRateValue")

    spark.stop()
  }
}
```
This job first loads the onsite attributed data and top frequent queries from text files. It then broadcasts the top frequent queries to all nodes in the cluster.

The job processes the onsite data in parallel using the `mapPartitions` transformation. For each partition, it initializes a local cache and hit/miss counters. It then iterates through each line in the partition and checks if the query is in the top frequent queries. If it is, it checks if the query is in the local cache. If it is, it checks if the query has expired. If it has not expired, it increments the hit counter. If it has expired, it increments the miss counter and updates the local cache with the new expiry time. If the query is not in the local cache, it increments the miss counter and adds the query to the local cache with the new expiry time.

After processing all partitions, the job updates the global cache with the local caches from each partition. It then calculates the hit rate by dividing the total number of hits by the total number of hits and misses.

Finally, the job prints the hit rate and stops the Spark session.

